INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अंग्रेजीको काइदा, भुक्नेलाई फाइदा', 'Angreji ko kaida, bhukne lai faida', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अकटको कुलो, बिकटको खेत, बिर्सेछु दाजै शिलोकको फेद', 'Akat ko kulo, bikat ko khet, birsechhu daajai silok ko fed', '', '2022-07-31 05:15:52');
