INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अकबरी सुनलाई कसी लाउनु पर्दैन', 'Akabari sun lai kasi laaunu pardaina.', 'Ramro manche yesai ramro', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अक्चु खाए बक्छु खाए झुसे बारुलो', 'Akchhu khaaye bakchhu khaaye jhuse baarulo', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अगुल्टोले हानेको कुकुर बिजुलीदेखि तर्सन्छ', 'Agulto le haaneko kukur bijuli dekhi tarsanchha.', 'Ek choti galti garisakepaxi aarko choti garna bata tarsinxa', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अगुल्ठो पनि नठोसी बल्दैन', 'Agultho pani nathosi baldaina', 'कुनै पनि सम्बन्धमा केही असामान्य हुन आवश्यक हुन्छ', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अघि हेर्नु चार हात, पछि हेर्नु बाह्र हात', 'Aghi hernu chaar haat, pachhi hernu bahra haat', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अघिको तीतो पछिको मीठो', 'Aghi ko tito pachhi ko mitho.', 'Mehanat le fal mitho hunxa', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अचानो को पिर खुकुरी ले जान्दैन', 'Achaano ko pir khukuri le jaandaina', 'Dhukha dina manxe le dukha paune manxe ko samsya bujdiaena', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अचार खानु मुलाको, संगत गर्नु ठुलाको', 'Achaar khaanu mula ko, sangat garnu thula ko', 'Asal manxe ko sangat gare khushi paixa nabye dukha', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अच्छा साले जुल्फी पाले, लिखाले टांग हाले', 'Achchhaa saale julfi paale, likhaa le taang haale.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अजिङ्गरको आहारा दैवले जुराउँछ', 'Ajingar ko aahaaraa daiba le jurauchha.', 'Yedi kei kura vagya ma chha vane paincha.', '2022-07-31 05:15:52');
