INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अन्धाको देशमा आँखा छोप्नु, लङ्‍गडाको देशमा खुट्‍टा खोच्याउनु', 'Andhaa ko desh maa aankhaa chhopnu, langadaa ko desh maa khuttaa khochchyaunu.', '', '2022-07-31 05:15:52');
