INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अन्नमा भन्दा सन्नमा जोड', 'Anna ma bhanda Sanna ma jod.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अन्यायको धन, कहिल्यै मेरो नभन', 'Anyaaye ko dhan, kahilei mero nabhan.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अभागी मोरो हग्न बस्यो, बाह्र हातको घोँचो पस्यो', 'Abhaagi moro hagna basyo, bahra haat ko ghocho pasyo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अभागीको भाई सप्रन्छ, भाग्यमानीको छोरो सप्रन्छ', 'Abhaagi ko bhai sapranchha, bhaagyamaani ko chhoro sapranchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अराएको काम र भराएको मानोले कति दिन चल्छ', 'Araayeko kaam ra bharaayeko maano le kati din chalchha', '', '2022-07-31 05:15:52');
