INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अरूले हात्ती चढे भनेर आफूले धुरी चढ्नु हुँदैन', 'Aru le hatti chade bhanera aafu le dhuri chadnu hudaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्काको आङ्गको जुम्रा देख्‍ने, आफ्‍नो आङ्गको भैसी पनि नदेख्‍ने', 'Arka ko aang ko jumra dekhne, aafno aang ko bhaisi pani nadekhne.', 'It is easy to point others fault but don\'t realize his own faults.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्काको गहना लगाउनु, नाक कान दुखाउनु', 'Arka ko gahana lagaunu, naak kaan dukhaunu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्काको नासो गलपासो', 'Arkaa ko naaso galpaaso.', '', '2022-07-31 05:15:52');
