INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्काको बारीमा साग छ, मुटु मिचेर के लाग्छ', 'Arkaa ko baari maa saag chha, mutu michera k laagchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्काको बुद्धिले राजा हुनुभन्दा आफ्नै बुद्धिले जोगी हुनु बेस', 'Arka ko buddhi le raja hunu bhanda afnai buddhi le jogi junu besh.', 'Aru ko muni basera thulo manxe hunu bhanda aafnaie malik aafaie bayera sano kaam garna jati hunxa', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्काको भर भोकभोकै मर', 'Arkaa ko bhar bhok bhokai mar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्तीको कुरा घर्तीको पनि लिनुपर्छ', 'Arti ko kura gharti ko pani linuparchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अर्थ न बर्थ गोविन्द गाई', 'Artha na bartha gobinda gai.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अलिनु पनि नखाऊँ, नूनढिकी पनि नफोरौँ', 'Alinu pani nakhau, nundhiki pani naforau.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अल्छीलाई बल्छी, मर्दलाई जाल', 'Alchhi lai balchhi, marda lai jaal.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अल्छीले जति जैसीले जान्दैन', 'Alchi le jati jaisi le jaandaina', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अल्छे तिघ्रो, स्वादे जिब्रो', 'Alchhe tighro, swade jibro.', 'Kaam garni jagar chaina khana mitho mitho khojni', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('असारमा आली लगाए पो मंसिरमा बाली खान पाइन्छ', 'Asaar maa aali lagaaye po mangshi maa baali khaana paayinchha.', '', '2022-07-31 05:15:52');
