INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('असारमा सुरुवाल लगाउनेले मंसिरमा पराल चोर्छ', 'Asaar ma suruwal laguane le mangsir ma paral chorchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अहंकारी भ्यागुताको ट्वार ट्वारै ठूलो', 'Ahankari bhyaguto ko twar twar nai thulo', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('अँध्यारो काम खोला को गीत', 'Andhyaro kaam khola ko geet', 'भेउ नपाई गरिएको काम', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आँ गर्दा अलङ्‍कार बुझ्ने', 'Aa gardaa alangkaar bujhne.', 'Jati bhaneko cha tyo bhanda badi bujhne.', '2022-07-31 05:15:52');
