INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आँटेको काम झट्टै श्री गणेश', 'Aateko kaam jhattai shree ganesh.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आँपको आँप, कोयाको दाम', 'Aanp ko aanp, khoya ko daam', 'नाफादार थोकबाट त नाफा छ नै तर जे कुराबाट आशा छैन, त्यसबाट पनि लाभ पाउनु', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आइमाई को रुपै सत्रु, रुपै मित्रु', 'Ayimaayi ko rupai satru, rupai mitru.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आइमाईको पेटमा कुरा पच्दैन', 'Aayimai ko pet maa kura pachhdaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आई बूढी मच्चिंदै, गई बूढी थच्चिंदै', 'Aaayi budi machchidai, gayi budi thachchidai.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आई लाग्ने माथि जाई लाग्नु', 'Aayi laagne maathi jaayi laagne.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आउँछ समय पर्खंदैन, बग्छ खोलो फर्कंदैन', 'Aauchha samaye parkhadaina, bagchha khola farkadaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आए आँप गए झटारो', 'Aaye aanp gaye jhataaro.', 'Try everything and explore all the ways if you have nothing to loose.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आए बाउको गए साहुको', 'Aaye bau ko gaye saahu ko', 'Taking a chance.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आकाश को राहु, पातलको केतु, एक पटक नपरी कसरी चेतु', 'Akash ko rahu, paataal ko ketu, ek patak napari kasari chetu?', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आकाशको फल आँखा तरी मर्', 'Aakas ko fal, aankha tari mar.', 'Aafu le napaune khaie na paune kura laie herera santhustha garni', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आकाशमा थुके मुखमा छिटा', 'Aakash maa thuke, mukh maa chhitaa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आखाँले देखेको बिज्ञान भन्दा मनले बुझेको भगवान प्यारो', 'Ankha le dekheko bigyan bhanda man le dekheko bhagwan pyaro.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आगो ताप्नु मुढाको कुरा, सुन्‍नु बुढाको', 'Aago taapnu muda ko kura sunnu buda ko', 'Aafu vanda thulo manxe ko aardi upadesh sunna parxa', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आज घर पुगिएला त ? आफ्नै खुट्टालाइ सोध', 'Aaja ghar pugiyela ta? aafnai khutta lai sodha', '', '2022-07-31 05:15:52');
