INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आजकालका केटी स्टाइलको भारी टाउकोमा भने डिस्को गर्ने जुम्राको ढाडी', 'Aajkal kaa keti style ko bhaari tauko maa bhane disko garne jumraa ko dhaadi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आजको कामलाई भोलि नभन्नु', 'Aaja ko kaam lai bholi nabhannu.', 'kaam na sachnu, aaja ko kaam aajai garni / There is not time like present.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आधा गाग्रो छचल्किन्छ', 'Adha gagro chhachalkinchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफु भलो त जगत भलो', 'Aafu bhalo ta jagat bhallo', 'afuleh pargati garda samaj ko pragati afai hunxa kinaki ek ek jana milera nai samaj banxa', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफुले खान नपाएको अंगुर अमिलो', 'Aafule khaana napaayeko angur amilo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफू ताक्छु मुडो, बन्चरो ताक्छ घुँडो', 'Afu taakchhu mudo, bancharo takchha ghundo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफू नमरी स्वर्ग देखिँदैन', 'Aafu namari swarga dekhidaina.', 'Aafu le kei kaam gari na heri thaha hunna', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफै त महादेव उत्तानो पर, कसले देला बर', 'Aafai ta mahadev uttaano par, kasle delaa bar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नै छोरी नखर्माउली, तन्नेरीलाई दोष', 'Aafnai chhori nakharmauli, tanneri lai dosh.', 'Aafno dosh naheri aru laie dosh lagaune', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो छोराछोरी र अर्काकी स्वास्नी सबैलाई राम्रो लाग्छ', 'Aafno chora chori ra arkaa ki swasni sabai lai ramro laagchha', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो टाउको फुटे पछि मित को टाउको बेल बराबर', 'Aafno tauko fute pachhi mit ko tauko bel baraabar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो थैली सुरक्षित राखे अर्कालाई दोष लगाउनु पर्दैन', 'Aafno thaili surakshit raakhe arkaa lai dosh lagaunu pardaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो थैलोको गाँठो कस्नु, अरुलाई दोष नदिनु', 'Aafno thailo ko gaatho kasnu, aru lai dosh nadinu.', 'Keep your work yourself and don\'t blame others.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो नुन, आफ्नै पानी, खाउ ज्वाईं कोखा तानी', 'Aafno nun, aafnai paani, khau juwai kokha taani', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो भाग्य आफैले बनाउनु पर्छ', 'Aafno bhaagya aafai le banaunu parchha.', 'mehanat garera aafno sapana afai pura garna sakinxa rather than wait for things to happen.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्नो रुचि खानु, अर्काको रुचि लाउनु', 'Aafno ruchhi khaanu, arkaa ko ruchi launu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आफ्‍नो हात जगन्‍नाथ', 'Aafno haat jagannaath.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमा पनि ब्युटी छोरि पनि ब्युटी बाउले गर्नु पर्ने चुलाको ड्युटी', 'Ama pani beauty, chori pani beauty, bau le garnu parne chula ko duty.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमा बाबुको मन छोरा छोरी माथि, छोरा छोरीको मन डिङगो जुत्ता माथि', 'Aama baabu ko man chhora chhori mathi, chhora chori ko man dingo juttaa maathi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमा बाबुलाई समस्या टार्न गार्हो, छोराछोरीलाई भने स्टाईल नै प्यारो', 'Aamaa baabu lai samasya taarna gahro, chhora chhori lai bhane style nai pyaaro.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमा-बाबा को मन छोरा तिर, छोरा को मन अर्काको छोरी तिर', 'Aama baba ko man chhora tira, chhora ko man arka ko chhori tira.', 'buwa ama ko maya chora lai chora bane budi kp kura matrai sunne', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमाको माया आँखाको डिलमा', 'Ama ko maya ankha ko dil maa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमाबाबुको मन छोराछोरी माथि छोराछोरीको मन ढुंगामुढा माथि', 'Aamaa baabu ko man chhoraachhori maathi choraa chhori ko man dhungaa mudaa maathi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आमा–छोराको ऐंचोपैंचो, बाबु–छोराको लेनदेन', 'Aamaa-chhoraa ko aicho paicho, baabu-chhoraa ko len den.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आम्दानी चार आनाको खर्च बाह्र आनाको', 'Aamdani chaar aanaa ko kharchaa bahra aanaa ko.', 'Aaye banda byaye dherai', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आयूको छोरालाई वायूको डर', 'Aayu ko choora lai baayu ko dar.', 'Hunai nasakne kura dekhi daraune', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आयो गयो माया मोह, आएन गएन को हो को हो', 'Aayo gayo maya moha, aayena gayena ko ho ko ho.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('आलु खाएर पेडाको धाक', 'Aalu khaayera pedaa ko dhaak.', 'Sano kaam garera thulo kaam ko dhaak dine', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('इखालु स्वास्नीको बचन, बहुला कुकुरको दाँत', 'Ikhaalu swaasni ko bachan, bahulaa kukur ko daat.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('इन्द्रको अगाडि स्वर्गको बयान', 'Indra ko agaadi swarga ko bayaan.', 'Kei kura bare derai thaha vayeko manxe laie tei kura bare bayan garnu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('इश्वर धपायो, शास्त्र चपायो', 'Ishwor dhapaayo, saastra chapaayo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ईट को जवाफ पत्थर ले दिनु', 'It ko jawaaf patthar le dinu.', 'Tit for Tat.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उखाने काका मन्तरी भाका', 'Ukhane kaka mantari bhaka.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उचालेको कुकुरले मृग मार्दैन', 'Uchaaleko kukur le mriga maardaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उठ बुहारी सास फेर, ढिकी छाड्नासाथ जाँतो हेर', 'Utha buhaari saas fera, dhiki chaadnaa saath jaato hera.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उत्ताउली गाईलाई बाघले खाई', 'Uttauli gaai lai bhaag le khaai', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उधारो प्रेम को कैची हो', 'Udhaaro prem ko kaichi ho.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उनीहरूको घरमा झगडा हाम्रो घरमा धुनधान', 'Uni haru ko ghar ma jhagada hamro ghar ma dhun dhaan.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उपाध्यायले तोङ्बा खायो, नाली नै रङ्यायो', 'Upadhaya le tongba khaayo, naali nai rangyaayo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उम्केको माछो ठुलो', 'Umkeko maachho thulo', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उसै त बूहारी मरिच खाएकी', 'Usai ta buhari marich khaayeki.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उसै त सासू सुन लगाएकी', 'Usai ta saasu sun lagaayeki', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('उही नाम्लो उही कुम्लो', 'Uhi naamlo uhi kumlo.', 'jati kura garepani aakhir ma afno kaam afai sangha hunxa', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ऋण काढेर घिऊ खानु', 'Rin kaadhera ghiu khaanu.', 'Gharo vaie rako bela sokhin jiwan juna khojnu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ऋण नलागे जमानी बस्नु', 'Rin nalaage jamaani basnu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ऋण लाग्दा नडराउनु, दिन लाग्दा डराउनु', 'Rin lagdaa nadaraunu, din laagdaa daraunu.', 'Rin lagyo vane tirna sakinxa tara din lagyo vani derai samasya aauna sakxa.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ऋण लिदा पनि नलिनु, दिदा पनि नदिनु', 'Rin lida pani nalinu, dida pani nadinu.', 'Rin linu ra dinu thik haiena.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एउटा घिउ बेचुवा, अर्को तरवार बेचुवा', 'Euta ghiu bechuwaa, arko tarbaar bechuwaa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एउटा थाप्लो दुईटा नाम्लो', 'Euta thaplo duita namlo', 'Euta kaam garna garo vaie rako bela arko kaam thapnu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एउटा पोईको दुईटा जोई, ख्वाउने बेलामा कोही न कोही', 'Euta poi ko duita joi, khuwaune bela maa kohi na kohi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एउटा भए सरासर, दुइटा भए भराभर, तिनवटा भए टाउको फोराफोर', 'Euta bhaye saraasar, duita bhaye bharaabhar, tin wota bhaye tauko foraafor.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एउटा सियो चोर अर्को फाली चोर', 'Euta siyo chor, arko faali chor.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एउटाले बिरायो साखा पिरायो', 'Euta le birayo sakha pirayo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक कान दुई कान मैदान', 'Ek kaan dui kaan maidaan.', 'Ek jana laie kei kura vane paxi gau vari ka laie tyo kura bare thana hunxa.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक कानले सुन्यो, अर्को कानले उडायो', 'Ek kaan le sunyo, arko kaan le udaayo.', 'Aru le vaneko ko kura hawa ma udaune.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक घर विष्ट, दश घर कामी, जस्ता तिमी उस्तै हामी', 'Ek ghar bista, das ghar kaami, jasta timi ustai haami.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक छाक खाने जोगी, दुई छाक खाने भोगी, तीन छाक खाने रोगी', 'Ek chhak khane jogi, dui chhak khane bhogi, tin chhak khane rogi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक थुकी सुकी, सय थुकी नदी', 'Ek thuki suki, saya thuki nadi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक पटकको चोर सधैँको चोर', 'Ek patak ko chor sadhai ko chor.', 'Ek patak aru ko naramro najar ma pare paxi tyo manxe sadaie naramrai hunxa. / Once you earn bad name, it will always be with you', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक पन्थ, दुई काज', 'Ek pantha, dui kaaj.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक माघले जाडो जाँदैन', 'Ek maagh le jaado jaadaina.', 'Ek choti vako kura feri feri huna sakxa.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक रुपैंया धन छ, घोडा किन्छु भन्छ', 'Ek rupaiya dhan chha, ghodaa kinchhu bhanchha', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक हातले तालि बज्दैन', 'Ek haat le taali bajdaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एकता नै बल हो', 'Ekataa nai bal ho.', 'Unity is strength.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एकातिर आँधी, अर्कोतिर झोलुङ्गो', 'Ekatira andhi, arko tira jhalungo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('एक्लो बृहस्पति झुट्‍टा', 'Eklo bhrihaspati jhuttaa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ओखरबोटमा चिल बस्यो, देखेपछि दिल बस्यो', 'Okhar botmaa chil basyo, dekhe pachhi dil basyo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('ओरालो लागेको मृगलाई बाच्छाले पनि खेद्छ', 'Oraalo laageko mrigha lai bachchhaa le pani khedchha.', 'Tala pare paxi sabai le hepxan.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('औंला दिंदा डुँडुल्ना निल्ने', 'Aulaa didaa dudulnaa nilne.', 'Give him an inch and he will take an yard, don\'t bite the hand that feed you.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('औषधी र उपदेश मीठो हुन्‍नँ', 'Ausadhi ra updadesh mitho hunna.', 'Aru le deko upadesh kasai laie ni ramro lagdaie na.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('औसींमा किनेर, पुर्णेमा फाल्ने', 'Aunsi maa kinera, purne maa faalne', 'Saman derai din samma natiknu', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कङ्गालको जात छैन, बोक्सीको गाउँ छैन', 'Kangaal ko jaat chhaina, boksi ko gaaun chhaina.', 'Jata pani dhalna sakne manxe ko bhar hudaie na.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कच्चा वैद्यको मात्रा यमपुरीको यात्रा', 'Kachchaa baidhya ko matraa yampurko yaatra.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कता हराइस् नौनी विलौनीमा', 'Kataa haraayis nauni bilauni maa.', 'Rup pariwartan garnu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कतै खातैखात, कतै पुर्पुरोमा हात', 'Katai khatai khat, katai purpuro ma haat.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कतै दिन, कतै रात, एकातिर भोक अर्कोतिर भात', 'Katai din, katai raat, ekaatira bhok arko tira bhaat.', 'Kosaie laie dhuka paie rako bela arko manxe ramaie lo gari rako hunxa.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कपाल दुखेको औषधी नाइटोमा लगाउनु', 'Kapaal dukheko ausadhi naito maa lagaunu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कपाल भन्दा टुपी छोटो', 'Kapal bhanda tuppi chhoto', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कमिलालाई सुसुको पहिरो', 'Kamila lai mut ko pahiro', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कम्बल ओढेर घ्यू खाने', 'Kambal odera ghiu khaane.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कर्कलालाई बन्चरो', 'Karkalaa lai bancharo', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कलिवुडको जात्रा तिघ्राको व्यापार', 'Kollywood ko jatra tighra ko byaapar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसाईंको अगाडि बाख्रा रोएको', 'Kasaayi ko agaadi bakhraa royeko.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसाईको अगाडी बाख्राको आँसुको के अर्थ', 'Kasai ko agadi bakhra ko anshu ko k artha', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसारको कुन गुदी कुन बोक्रो', 'Kasar ko kun gudhi kun bokro?', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसैको आहार कसैको विष', 'Kasai ko aahar, kasaiko bish.', 'Eutai kura ma bhibid bichar', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसैलाई के धन्दा घरज्वाईंलाई खानको धन्दा', 'Kasai lai ke dhandaa, ghar juwai lai khaana ko dhandaa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसैलाई लाखा, कसैलाई पाखा', 'Kasai lai kaakhaa, kasai lai paakhaa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कसैले तपाईं भनोस् नभनोस् आफैं मपाईं', 'Kasaile tapai bhanos nabhanos aafai mapai.', 'Aafno prasansa aafai garnu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कस्ता कस्ता कहाँ गए मुसाको बच्चा दरबारमा', 'Kasta kasta kaha gaye musa ko bacchha durbar maa', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कहाँ जान्छस् मछली मेरै ढडिया', 'Kaha jaanchhas machali merai dhadiya.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कही नभाको जात्रा प्रग्या प्रतिस्ठानमा', 'Kahi nabhayeko jaatraa pragya pritisthaan maa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कांही नभएको जात्रा हाँडी गाउँमा', 'Kahi navayeko jatra haadi gau maa.', 'Kei kaam pani thik sanga nahune.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काका भन्नु र कान्छा बाऊ भन्नु एउटै कुरो हो', 'Kaka bhannu ra kancha bau bhannu eutai kuro ho.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काग कराउदै गर्छ, पिना सुक्दै गर्छ', 'Kaag karaudai garchha, pinaa sukdai garcha.', 'Let the haters hate you always do what you want.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काग बस्नु, हाँगा भाँचिनु', 'Kaag basnu, haangaa bhaachinu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काग बाठो भयो भने गु खान्छ', 'Kaag batho bhayo bhane gu khanchha.', 'Derai jaani huna hunna', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काग भन्दा कोईली चंख', 'Kaag bhanda koili chankha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कागको नाम कागले काड्छ', 'Kaag ko naam kaag le kaadchha.', 'Aafno bhadnam aafai garni.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कागको बिचमा बकुल्ला', 'Kaag ko bich maa bakulla.', 'Bhinna ko bich ma hunu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कागलाई बेल पाक्यो, हर्ष न विस्मात्', 'Kaag lai bel paakyo harsa na bismaat.', 'koi manxe laie nachaie ne kura dinu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कागले कोइलिलाइ काले भन्छ', 'Kaag le koili lai kaale bhanchha', 'Aafu laie naheri aaru ko laie matra bhanu.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कानो गोरुलाई औंसी न पूर्णिमा', 'Kano goru lai aunshi na purnima.', 'Kaam garna naparni manxe laie sabai din ek naas hunxa.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम कुरो एकातिर कुम्लो बोकी ठिमीतिर', 'Kaam kuro ekaa tira kumlo boki Thimi tira.', 'Ek tira kaam xa arko tira jani', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम गर्दा नोकरले जसरी, खाना खाँदा राजाले जसरी', 'Kaam garda nokar le jasari, khaba khada raja le jasari.', 'Kaam garna pare paxi kaam garna ni tayar huni ani khana base paxi khana ni majja le khani.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम गर्ने कालु मकै खाने भालु', 'Kaam garne kaalu, makai khaane bhaalu.', 'Euta le kaam garni arko le pasansa/upahar paune.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम गर्ने हनुमान, पगदी कस्ने ढेडु', 'Kaam garne hanumaan, pagadi kasne dhedu', 'One does the work other gets the credit.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम छउन्‍जेल भाँडो, काम सकिएपछि ठाँडो', 'Kaam chhaunjel bhaado, kaam sakiye pachhi thaado.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम न काजको, दुश्मन अनाजको', 'Kaam na kaaj ko dusman anaaj ko.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम न धाम पेटभरी माम', 'Kaam na dhaam pet bhari maam.', 'Kaam naie nagari pet bhari khani', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम पनि छैन दाम पनि छैन', 'Kaam pani chhaina daam pani chhaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम पाईनस् बुहारी पाडाको ढाड कन्याई दे', 'Kaam paayinas buhaari paadaa ko dhaad kanyaai de.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम साँचे आफूलाई, खान साँचे अरूलाई', 'Kaam saache aafulai, khaana saache arulai.', 'If you want something done right, do it yourself.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कामीको पालो कात्तिकमा', 'Kaami ko paalo kaatikmaa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कामीको बिहे, अठार खाँचो', 'Kaami ko bihe, athaara khaacho.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काले काले मिलेर खाउँ भाले', 'Kaale kaale milera khau bhaale.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कालो अक्षर भैँसी बराबर', 'Kaalo akshar bhaisi barabar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कालो बादलले संधै पानी पार्दैन', 'Kaalo baadal le sadhai paani paardaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कालो बाहुन, गोरो शुद्र, यिनीदेखि डराउँछन् महारुद्र', 'Kaalo baahun, goro sudra, yini dekhi darauchhan mahaa rudra.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काशी जाने कुतिको बाटो', 'Kaashi jaane kuti ko baato.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('किन रोइस् मङ्‍गले आफ्‍नै ढंगले', 'Kina royis mangale aafnai dhangale.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('किनेको दाउरा किनेकै पानी, कर्मचारीका श्रीमती महलका रानी', 'Kineko daura kinekai pani, karmachari ka shrimati mahal kaa raani.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुकुर भुक्दै गर्छ, हात्ती लम्कँदै गर्छ', 'Kukur bhukdai garchha, hatti lamkidai garchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुकुरको पुच्छर बाह्र बर्ष सम्म ढुङ्रोमा राखेपनी बाङ्गाको बाङ्गै', 'Kukur ko puchhar bahra barsha dhungro maa raakhe pani bangaa ko baangai', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुकुरलाई मासु पैंचो', 'Kukur lai maasu paicho.', 'Lending things to someone who doesn’t know the value or they will never return the thing.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुकुरलाई घ्यू पच्दैन', 'Kukur lai ghyu pachdaina.', 'Naramro lai jaty ramro garepani pachdaina.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुकुरलाई लुतो', 'Kukur lai luto.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुकुरले खुट्टा टोक्यो भन्दैमा कुकुरको खुट्टा टोक्नु हुन्न', 'Kukur le khutta tokyo bhandai ma kukur ko khutta toknu hunna.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुक्कुरलाई हड्डी पैचो', 'Kukur lai haddi paicho.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुचोले बढार्नु पर्ने कसिङ्‍गर हावाले उडायो', 'Kucho le badaarnu parne kasingar hawa le udaayo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('काम छैन बुहारी पाडाको कन्डो कनाएर बस', 'Kam xaina buhari pada ko kando kanayera bas', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुन्ता कि बुहरी भ्टमास खाकि', 'Kunta ki buhari bhatmaas khaaki.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुन्ताको महादेव खरानी घसेको', 'Kunta ko mahadev kharaani ghaseko.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुप्री बुढीलाई उठी सुख न बसी सुख', 'Kupri budhi lai uthi sukha na basi sukha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुमालेको चक्र घुमी फिरी त्यहीँ आउँछ', 'Kumale ko chakra ghumi firi tyahi aaunchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुरो र कुलो जता लग्यो त्यतै जान्छ', 'Kuro ra kulo jataa lagyo tyatai jaanchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('कुसाइतमा पञ्‍चेबाजा', 'Kusaayit maa panche baajaa', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('के खोज्छस् कानो आँखो', 'Ke khojchhas kaano aankho.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('के खोज्छस् नेता कुर्सी', 'K khojchhas netaa kursi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('केटाकेटी आए, गुलेली खेलाए, मट्‍याङ्‍ग्राको सत्यानाश', 'Ketaketi aaye, guleli khelaaye, matyangra ko satyaanaas.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('केटी हेर्नै नपर्ने, केटो बोल्नै नपर्ने', 'Keti hernai naparne, keto bolnai naparne.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खर्च न बर्च, तीर्थ जानु पर्छ', 'Kharcha na barcha, tirtha jaanu parchha', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खसको कुरा पेटको छुरा', 'Khas ko kura pet ko chhuraa.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खसी जोख्‍नु सय चोटि, मान्छे जोख्‍नु एक चोटि', 'Khasi jokhnu saya choti, maanchhe jokhnu ek choti.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खसी देखाएर फर्सी भिडाउनु', 'Khasi dekhayera farsi bhidaunu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खसी भनम बोसो छैन, बोको भनम नसो छैन', 'Khasi bhanam boso chhaina, boko bhanam naso chhaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाइछाड कि लाइछाड, मरेपछि लम्पसार', 'Khaayi chhad ki laayi chaad, mare pachhi lampasaar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाई न पाई छालाको टोपी लाई', 'Khaayi na paayi chaalaa ko topi laayi.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाई न पाई दौरामाथि टाई', 'Khaayi na paayi, dauraa maathi tai.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाउँ कर्कली, पेट फर्कली, नखाउँ कर्कली, सासू झर्कली', 'Khau karkali pet farkali, nakhau karkali saasu jharkali.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाए खा नखाए घिच', 'Khaaye khaa nakhaaye ghich.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खान जाने औषधि, खान नजाने विष', 'Khana jane ausadhi, khana najane bish.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाने पिउने रामे, चोट पाउने चामे', 'Khaane piune Raame, chot paaune Chaame.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाने बेलामा घिन नसम्झनु, सुत्ने बेलामा ऋण नसम्झनु', 'Khane bela ghin nasamjhinu, sutne bela rin nasamjhinu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खाने मुखलाई जुँगाले छेक्दैन', 'Khaane mukh lai jungaa le chhekdaina', 'Where there is will there is way.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खान्न–खान्न लोकाचार, खाएपछि माना चार', 'Khanna khanna lokachaar, khaaye pachhi maanaa chaar', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खायो खुदो मुख उँदो', 'Khayo khudo mukh udo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खिर ख्वाएर हिलोले चुठाउँने', 'Khir khuwayera hilo le chuthaune.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खुट्टा भए संसार हिडिन्छ', 'Khutta bhaye sansar hidinchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खुट्‍टा भए जुत्ता हजार', 'Khutta vaye jutta hajar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खुर्सानी बिना भतेर अड्किन्न', 'Khursani bina bhater adkinna.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खुस्किन लागेको हाकिमलाई पिउनले पनि लखेट्छ', 'Khuskina laageko haakim lai piun le pani lakhetchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खेताला पल्काउनु, पाहुना तर्साउनु', 'Khetala palkaunu, pahuna tarsaunu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खेताला लाए छैन काम, छोराछोरी पठाए आधा काम, आफू गए पुरै काम', 'Khetala laaye chhaina kaam, chora chori pathaye adha kaam, aafu gaye purai kaam.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खेती आफ्नो राम्रो, श्रीमती अर्काको', 'Kheti afno ramro, shrimati arka ko.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खोला तर्यो लौरो बिर्सियो', 'Kholaa taryo lauro birsiyo.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खोला र माया तलतिरै बग्छ', 'Khola ra maya tala tirai bagchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('खोलाको देशमा पानीको दुःख', 'Khola ko desh ma pani ko dukha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गधा भारी नपुगी उठ्दैन', 'Gadhaa bhaari napugi uthdaina', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गर्जने बादल वर्षदैन', 'Garjane baadal barshadaina.', 'Thunder clouds do not always give rain.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गहिराको घरलाई पहिराको डर, डाँडाको घरलाई जाडाको डर', 'Gahiraa ko ghar lai pahiraa ko dar, dandaa ko ghar lai jaadaa ko dar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गाँस छाड्नु तर साथ नछाड्नु', 'Gash chhadnu tara sath nachhadnu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गाई गंगा बराबर', 'Gaayi gangaa baraabar.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गाउँ भरिको साईनो, पानी खान पाइन', 'Gau bhari ko saino, paani khana paina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गाग्रीमा पानी छैन, तिहुनमा झोल', 'Gaagri maa paani chhaina, tihun maa jhol.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गिद्धको सामु कौवाको पखेटा', 'Giddha ko saamu kauwa ko pakheta', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गीत गाउनेको सुसेलीबाटै थाहा हुन्छ', 'Geet gauneko suseli baatai thaahaa hunchha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गु खानेले गु खाए पनि मुत्नेले नचुटे', 'Gu khaane le gu khaaye pani mutne le nachute.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गु पुछेको टालो पनी बेलामा काम लाग्छ', 'Gu puchheko taalo pani bela maa kaam laagchha.', 'One man\'s trash is another man\'s wealth.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गु लाई चलाए गन्ध', 'gu lai chaleye gandha', 'Bad things have bad results.', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गुनले गुन खान्छ, तँलाई म खान्छु', 'Gun le gun khanchha, ta lai ma khanchhu.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गुन्द्रुक पकाउनु पर्दैन, साली फकाउनु पर्दैन', 'Gundruk lai pakaunu pardaina, saali lai fakauna pardiana.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गुन्द्रुकलाई पकाउनु पर्दैन', 'Gundruk lai pakauna pardaina.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गुरु मान्नु बुझेर, बिहे गर्नु रोजेर, पानी खानु छानेर, कुरो गर्नु जानेर', 'Guru maannu bujhera, bihe garnu rojera, paani khaanu chhaanera, kuro garnu jaanera', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गुरू गुँढ चेला चिनी', 'Guru gud chelaa chini.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गुलाई चलाए गन्ध', 'Gu lai chalaaye gandha.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गोडा मुती न्यानो', 'Godaa muti nyaano.', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गोरु नभएको हली र ठेडी नभएको हलोको के काम', 'Goru nabhayeko hale ra thedi nabhayeko halo ko k kaam', '', '2022-07-31 05:15:52');
INSERT INTO Post (nepali, roman, meaning, updatedAt) VALUES ('गोलीको घाउ निको हुन्छ, बोली को हुँदैन', 'Goli ko ghau niko hunchha, boli ko hudaina', 'pain inflicted by world never heals so be wise and aware about how you talk and converse with people.', '2022-07-31 05:15:52');
